import React from 'react';

function ListTodoComponent(){

    const todos = [
        {
            id: 1,
            desc: "Learn React",
            done: false,
            date: new Date()
        },
        {
            id: 2,
            desc: "Learn java",
            done: false,
            date: new Date()
        },
        {
            id: 3,
            desc: "Learn springboot",
            done: false,
            date: new Date()
        }
    ]

    return (
        <div>
            <h1>List Todo</h1>
            <div className="container">
                <table className="table">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Description</th>
                            <th>Done</th>
                            <th>Date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            todos.map((todo,index) => 
                            <tr key={"todo"+index}>
                                <td>{todo.id}</td>
                                <td>{todo.desc}</td>
                                <td>{todo.done.toString()}</td>
                                <td>{todo.date.toString()}</td>
                            </tr>    
                            )
                        }
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default ListTodoComponent;
